import {useState} from 'react';

function Search() {
    const [input, setInput] = useState("");

    return (
        <form>
            <div>
                <input 
                    onChange={(e) => setInput(e.target.value)}
                    type="text" 
                    value={input} 
                />
            </div>
        </form>
    )
}


export default Search
